column8:
●楽天ランキング(2013年3月21日付)ベッド・カドラーランキングデイリー第1位獲得！<br><br>
<b>16日～19日ご注文分は22日以降の発送です。</b>
<br><br>
●自然の風を利用するので安全で健康的！<br>
中心部がメッシュ素材なので、自然の風でわんちゃんもリラックスして休むことができます。<br>
涼しいところに置くと、夏場のお昼寝に最適です。
<br><br>

●水洗いもOK！(手洗い)<br>
メッシュ付布地部分は取り外し後、水洗い可能です。<br>
いつも清潔にお使いいただけます。<br><br>

●小型犬から大型犬まで幅広く対応できる3サイズ！<br>
M・L・XLの3サイズあります。<br>
中央の補助アームはL・XLサイズのみの仕様となります。<br><br>

●便利で丈夫な折りたたみ式！<br>
収納にも移動にも活躍する折りたたみ式。たためばグーンとコンパクトになります。<br>
また、鉄フレームになっているのでとっても丈夫です。<br><br>

<hr>
●素材<br>
ポリエステル・PVC・鉄パイプ<br><br>

●サイズ<br>
(XL)約120cm×80cm×高さ18.5cm<br><br>

●重量<br>
(XL)約4.5kg<br><br>

●耐荷量<br>
サイズが合っていれば基本的にOKですが、最大約45kgまでとなります。<br><br>
<hr>
<br>
※形状・お色・サイズが、写真・サイズ表示と多少異なる場合があります。<br>予めご了承下さい。<br>

※ご使用の際は、取扱説明書を十分にお読み下さい。<br><img src="http://image.rakuten.co.jp/joy-bu/cabinet/banner/img63612705.jpg">
